using EspCid.Domain.Entities;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;

namespace EspCid.Infrastructure.Configuration;

public class PhotoConfiguration : IEntityTypeConfiguration<Photo>
{
    public void Configure(EntityTypeBuilder<Photo> builder)
    {
        builder.ToTable(nameof(Photo));
        builder.HasKey(b => b.Id);
        builder.Property(b => b.Id).ValueGeneratedOnAdd();
        builder.Property(p => p.ImageData).IsRequired();

        builder.HasData(
            new Photo
            {
                Id = 1,
                ReportId = 1,
                ImageData = System.Text.Encoding.UTF8.GetBytes("data:image/webp;base64,")
            },
            new Photo
            {
                Id = 2,
                ReportId = 1,
                ImageData = System.Text.Encoding.UTF8.GetBytes("data:image/jpeg;base64,")
            },
            new Photo
            {
                Id = 3,
                ReportId = 2,
                ImageData = System.Text.Encoding.UTF8.GetBytes("data:image/jpeg;base64,")
            },
            new Photo
            {
                Id = 4,
                ReportId = 3,
                ImageData = System.Text.Encoding.UTF8.GetBytes("data:image/webp;base64,")
            }
        );
    }
}
